	(1, 'Las Personas Que Efectuarán El Trabajo ¿Se Encuentran Calificadas Para Desarrollas Este Tipo De Labores?', '', 'Activo', '2025-10-18 16:49:11', '2025-10-18 16:49:11'),
	(2, '¿Ha Sido Instruido El Personal En Relación Con Los Riesgos Que Puedan Presentarse Durante El Trabajo?', '', 'Activo', '2025-10-18 16:49:18', '2025-10-18 16:49:18'),
	(3, '¿El Personal Cuenta Con Sus Equipos De Protección Personal Para Realizar Sus Labores Y Estas Se Encuentran En Buenas Condiciones ?', '', 'Activo', '2025-10-18 16:49:25', '2025-10-18 16:49:25'),
	(4, '¿Se Ha Delimitado Y/O Aislado Convenientemente La Zona De Trabajo?', '', 'Activo', '2025-10-18 16:49:30', '2025-10-18 16:49:30'),
	(5, 'Se Encuentra Equipos Y/O Herramientas Revisadas Y En Buenas Condiciones', '', 'Activo', '2025-10-18 16:49:36', '2025-10-18 16:49:36'),
	(6, 'Permiten Los Factores Externos (Condiciones Atmosféricas) Que El Trabajo Se Realice Con Seguridad', '', 'Activo', '2025-10-18 16:49:41', '2025-10-18 16:49:41'),
	(7, '¿Permiten Las Operaciones, Equipos Y Conexiones Eléctricas Cercanas Realizar Este Trabajo Con Seguridad', '', 'Activo', '2025-10-18 16:49:47', '2025-10-18 16:49:47'),
	(8, 'Se reconoce haber verificado los siguientes equipos, herramientas de trabajo y protección personal (EPP);en forma obligatoria antes de realizar las labores de trabajo, así como reconocer la identificación de riesgo y peligros  para la actividad laboral a realizarse; con el  fin de evitar los accidentes en el desempeño de sus labores, así como lo establece el \r\neglamento de Seguridad e higiene Ocupacional, el Plan de Contingencias y el Código de Ética de la empresa SERSA, dando cumplimiento lo establecido por el DS N.º 005-2012-TR  RM N.º 111-2013-MEM/DN, y la LEY 29783.  ', NULL, 'Activo', '2025-10-18 16:52:39', '2025-10-18 16:53:10');
